import React from 'react';
import { Route, Routes} from 'react-router-dom';
import Home from './Home';
import Movies from './Movies';
const Pages = () => {
  return (
    <Routes>
        <Route path="/" element={<Home/>}/>
        <Route path="/movie" element={<Movies/>}/>
    </Routes>
  )
}

export default Pages
